export function getChineseLunarMonthNameTest() {
	assert.strictEqual(lunar.getChineseLunarMonthName(3), "")
	assert.strictEqual(lunar.getChineseLunarMonthName(12), "")
	assert.strictEqual(lunar.getChineseLunarMonthName(11), "")
}

export function getChineseLunarDayNameTest() {
	assert.strictEqual(lunar.getChineseLunarDayName(1), "")
	assert.strictEqual(lunar.getChineseLunarDayName(12), "")
	assert.strictEqual(lunar.getChineseLunarDayName(21), "")
	assert.strictEqual(lunar.getChineseLunarDayName(30), "")
}

export function getChineseZodiacTest() {
	assert.strictEqual(lunar.getChineseZodiac(2008), "")
	assert.strictEqual(lunar.getChineseZodiac(2019), "")
}

export function getChineseLunarFestivalTest() {
	assert.strictEqual(lunar.getChineseLunarFestival(1900, 1, 1), "")
	assert.strictEqual(lunar.getChineseLunarFestival(1900, 7, 7), "")
	assert.strictEqual(lunar.getChineseLunarFestival(1900, 7, 8), undefined)
}